import React from 'react'

const Payment = () => {
  return (
    <>
        <div className="payment-container">
            <div className="card">Credit/Debit Card</div>
            <div className="upi">UPI</div>
            <div className="cod"></div>
        </div>
    </>
  )
}

export default Payment
